import React, { Component } from 'react'
import style from './Second.module.css'
class Second extends Component {
  render() {
    return (
      <div id={style.second}>
      <h2>The power of Premium</h2>
      <div id={style.powers}>
        <div><i class="fa-solid fa-comment-slash"></i></div>
        <div><i className="fa-solid fa-music"></i></div>
        <div><i class="fa-solid fa-house-laptop"></i></div>
        <div><i className="fa-solid fa-circle-play"></i></div>
      </div>
      </div>
    )
  }
}

export default Second
